import React, { Component } from 'react'

class SearchList extends Component {

    constructor(props){
        super(props);
    };

    render() {
        const myData= this.props.searchData;
        console.log(myData);

        return (
            <div className="searchList row">
                {
                    myData.map((item, index) => {
                        this.myData[0].title
                    })
                }
            </div>
        )
    }
}

export default SearchList;
